import React from 'react';
import { Alert, Button,  StyleSheet, View } from 'react-native';


class App extends React.Component{
  handleClick = () => {
    console.log('this is:', this);
  }

  render() {
    return (
      <button onClick={this.handleClick}>
        Click me
      </button>
    );
  }
}
